import React from "react";
import "../css/contact.css";

const Contact = () => {
  return (
    <div>
      <h1>Contact Us</h1>
      <input placeholder="ime"></input>
      <input placeholder="prezime"></input>
      <input placeholder="kompanija"></input>
      <input placeholder="email"></input>
      <input placeholder="telefonski broj"></input>
      <input placeholder="broj na vraboteni"></input>
      <input placeholder="sektor"></input>
      <textarea placeholder="Poraka"></textarea>
    </div>
  );
};

export default Contact;
